import React from "react";
import s from "./Profile.module.css";
import MyPost from "./MyPosts/MyPosts";
import ProfileInfo from "./ProfileInfo/ProfileInfo";

const Profile = (props) => {

  return (
    <div>
      <ProfileInfo />
      <MyPost updateNewPostText={props.updateNewPostText} postData={props.state.postData} newPostText={props.state.newPostText} addPost={props.addPost} />
    </div>
  );
};

export default Profile;
